INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(187442, 'frFR', '', 'La liste de vos péchés est fort longue. Mais lâcher vos bêtes sur des innocents est le plus cruel de tous.', 37474),
(38124, 'frFR', 'Acceptez les ténèbres… éternelles !', 'Acceptez les ténèbres… éternelles !', 37474),
(180366, 'frFR', '', 'C\’est un plaisir de vous accueillir au Bastion. Même si je dois bien dire que… je n\’avais jamais vu d\’âme comme vous. Mais peu importe !', 37474),
(187280, 'frFR', 'Maintenant que la maison des Yeux est éliminée, le secret est préservé. Il n\’y a plus personne pour nous entraver.', '', 37474),
(185904, 'frFR', 'Jaloux, moi ? Vous plaisantez. Ce maraud ne m\’arrivait pas à la cheville !', '', 37474),
(182733, 'frFR', 'La marque de connaissance, ultime rempart contre l\’ignorance et la peur.', '', 37474),
(180367, 'frFR', '', 'Vous allez rejoindre les Kyrians ! Notre devoir sacré est de mener les âmes mortelles devant l\’Arbitre pour qu\’elles soient jugées.', 37474),
(194383, 'frFR', '', 'Ce devrait être assez passionnant.', 37474),
(182626, 'frFR', '', 'Quand vous le voudrez, approchez de la flamme et suivez les instructions du guetteur.', 37474),
(202313, 'frFR', '', 'Embrocher, taillader, lacérer, disséquer, découper en lamelles… Je m\’y vois déjà !', 37474),
(202311, 'frFR', 'Maintenant que tu le dis… nous pourrions les écorcher vifs, ces misérables, et nous servir de leurs os pour paver la voie de notre ascension. Quel dilemme cornélien…', '', 37474),
(202310, 'frFR', '', 'J\’ai une meilleure idée, ô mon Maître ! Laissez-moi plutôt les tailler en pièces !', 37474),
(202312, 'frFR', '', 'S\’il vous plaît, ô mon Maître ! Ça fait si longtemps que je n\’ai pas goûté à la chair fraîche !', 37474),
(202315, 'frFR', 'Je vais guider nos invités sur la voie de l\’expiation. Quand ils se seront repentis, tu seras libre de malmener leurs corps et de livrer leurs âmes meurtries en pâture à l\’Antre !', '', 37474),
(205464, 'frFR', '', 'Je vois à présent pourquoi les êtres de votre monde sont aussi craints. Il n\’est pas étonnant que vous ayez réussi à résister à la Légion ardente. Au nom de Sylvarden, je vous sais gré de votre force.', 37474),
(191962, 'frFR', '<Des mots sont gravés sur le socle de la statue.>\n\nC\’est lors de l\’épreuve de la puissance que se gagne le respect. Ne sont dignes de notre Salut que ceux qui s\’élèvent au-dessus de la masse.', '', 37474),
(191966, 'frFR', '<Un texte est gravé sur le piédestal de la statue.>\n\nL\’obscurité recèle parfois des vérités cachées. Les plus habiles œuvrent Furtivement par-delà leurs ennemis.', '', 37474),
(180775, 'frFR', 'Il faut avertir… le droman…', 'Il faut avertir… le droman…', 37474),
(193577, 'frFR', '', 'Tenez ça un petit instant.', 37474),
(186290, 'frFR', 'Élégante et puissante, une couronne apte à défendre un royaume.', '', 37474),
(193598, 'frFR', '', 'Bon, où est-ce que je vais mettre tout ça ?', 37474),
(193582, 'frFR', '', 'Vous voulez essayer un peu ?', 37474),
(203409, 'frFR', 'Une arme… forgée aux flammes de Tourment. Ainsi naît une lame porteuse de deuil.', '', 37474),
(196707, 'frFR', 'Faites feu dès que possible !', '', 37474),
(199409, 'frFR', 'Mon anima ? Et pourquoi la vieille Tirnenn ne pourrait pas s\’en charger ?', '', 37474),
(199444, 'frFR', 'Là. Et qu\’on en finisse !', '', 37474),
(198956, 'frFR', 'Je n\’ai pas de temps à accorder à $gun:cette:c; $c. La comtesse attend.', 'Je n\’ai pas de temps à accorder à $gun:cette:c; $c. La comtesse attend.', 37474),
(206412, 'frFR', '', 'Qu\’est-ce qui vous amène en Maldraxxus, $p ?\n\nVous faut-il plus de champignons pour les festins de votre cour, ou plus de soldats maldraxxi pour défendre vos murs ?\n\n<La baronne Vashj sourit.>\n\nJe dois avouer que la cour des Braises me divertit bien plus que je ne l\’imaginais.\n\nLe prince Rénathal joue peut-être les hôtes sur la scène principale, mais c\’est vous que j\’observe la plupart du temps.\n\nC\’est vous qui organisez les choses dans les coulisses, comme je le faisais lors des réceptions de la reine, à l\’époque.\n\n<Les yeux de la baronne Vashj se perdent dans le vide un instant.>\n\nCe n\’est pas facile, ce que vous faites.', 37474),
(202361, 'frFR', 'Bienvenue aux archives des Âges, où un afflux d\’anima nous permet de décupler vos capacités.\n\nGrâce à mon amélioration, vous bénéficierez de la technique suivante :\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[Étoile polaire de l\’ascendant]|h|r : Quand vous avez plus de 90% de vos points de vie, vos sorts et techniques de dégâts ont une chance de lancer Marque de récupération sur la cible, ce qui lui inflige des dégâts sur la durée. Vaincre un ennemi pendant ce laps de temps permet de récupérer son anima et de bénéficier brièvement d\’un bouclier.', 'Bienvenue aux archives des Âges, où un afflux d\’anima nous permet de décupler vos capacités.\n\nGrâce à mon amélioration, vous bénéficierez de la technique suivante :\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[Étoile polaire de l\’ascendant]|h|r : Quand vous avez plus de 90% de vos points de vie, vos sorts et techniques de dégâts ont une chance de lancer Marque de récupération sur la cible, ce qui lui inflige des dégâts sur la durée. Vaincre un ennemi pendant ce laps de temps permet de récupérer son anima et de bénéficier brièvement d\’un bouclier.', 37474),
(199451, 'frFR', '', 'Ha… Il y a bien cette fois où Tisse-Rêves…', 37474),
(183994, 'frFR', '', 'Un peu à gauche !', 37474),
(183995, 'frFR', '', 'À gauche ! À droite ! Non, l\’autre droite !', 37474),
(183993, 'frFR', 'Tu peux atteindre le sommet ?', '', 37474),
(204708, 'frFR', 'Feu Blanchette montre docilement ses sabots, heureuse que l\’on s\’occupe de ses pattes endolories. Elle est à bout de souffle, respire très fort et semble assoiffée.', '', 37474),
(204686, 'frFR', 'Pendant que vous la brossez pour ôter les irritants de sa peau, feu Blanchette tremble et vous donne de petits coups de tête. Elle se balance en martelant le sol et vous remarquez que ses sabots sont très abîmés.', '', 37474),
(204663, 'frFR', 'Feu Blanchette accepte l\’avoine avec joie. Son poil est touffu par endroits, mais partout, sa peau est irritée par des piqûres d\’insectes, des égratignures et une boue malodorante.', '', 37474),
(204710, 'frFR', 'Feu Blanchette ne bronche pas lorsque vous placez le tapis de selle sur son dos. Ses tremblements s\’atténuent puis s\’arrêtent, et elle commence à fouiller vos sacs à la recherche de nourriture.', '', 37474),
(204668, 'frFR', 'Feu Blanchette s\’arrête brusquement pour éviter de vous renverser.', '', 37474),
(204903, 'frFR', 'Le regard de feu Blanchette est affolé ; son corps est émacié et malade. Elle est clairement affamée et elle a besoin d\’un repas copieux.', '', 37474),
(121956, 'frFR', 'Moi, Maître Mathias Shaw, autorise la Lame rouge à pourchasser l\’agent dissident Amber Kearnen.', '', 37474),
(204709, 'frFR', 'Feu Blanchette boit goulûment le contenu du seau avant de vous donner un coup de tête. Sa soif est étanchée mais elle tremble de manière incontrôlable.', '', 37474),
(54130, 'frFR', '', 'Rell est… il est grièvement blessé.$b$b<L\’agent Kearnen frappe le sol du poing.>$b$bIl est en train de mourir, $n ! Et il n\’y a rien que nous puissions faire !', 37474),
(204749, 'frFR', 'Les naseaux de feu Blanchette se dilatent lorsqu\’elle renifle les pommes. Elle les dévore avec empressement, soupire de contentement, puis pose sa tête sur votre épaule.', '', 37474),
(121283, 'frFR', 'Amber Kearnen était des nôtres… Je n\’arrive toujours pas à croire qu\’on ait dû la tuer.', '', 37474),
(197546, 'frFR', '', 'Assez ! Vos mouvements saccadés me rendent malade !', 37474),
(207303, 'frFR', 'Merci de nous aider à sauver la forêt, $Gchasseur:chasseresse;.', 'Merci de nous aider à sauver la forêt, $Gchasseur:chasseresse;.', 37474),
(189107, 'frFR', 'Bien que nous ayons grand besoin de lanceurs de sorts capables, nous maintiendrons les conditions d\’admission actuelles.', '', 37474);
INSERT INTO `faction_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2463, 'frFR', 'Marasmius', 'Cette étrangeté aux allures fongiques fait partie de l\’écosystème de Sylvarden depuis des temps immémoriaux. Votre bienveillance a touché ce qu\’on pourrait apparenter à son cœur et il a toujours de quoi vous occuper.', 37474),
(2410, 'frFR', 'Armée immortelle', 'Il y a une éternité de cela, le Primat fonda les cinq maisons de Maldraxxus dans le but de constituer l\’armée ultime. Que ce soit par la force, l\’intelligence ou la ruse, ces troupes ont juré de défendre l\’Ombreterre envers et contre tous.', 37474),
(2465, 'frFR', 'L\’Hallali', 'Mobilisé pour servir la reine de l\’hiver en temps de crise, l\’Hallali rassemble les meilleurs chasseresses et chasseurs de Sylvarden. Face à la pénurie et au danger, ils se tiennent prêts à défendre la forêt.', 37474),
(2462, 'frFR', 'Maîtres des sutures', 'Spécialistes réputés de la fusion des chairs, des os et de l\’anima pour créer des assemblages, les maîtres des sutures s\’avèrent de puissants alliés en Maldraxxus. Ils se sont installés au Billot après avoir quitté la maison des Assemblages et ses traîtres.', 37474),
(2464, 'frFR', 'Cour de la Nuit', 'La pénurie d\’anima et l\’invasion des Drust accaparent toute l\’attention de la reine de l\’hiver et de l\’Hallali, ce qui laisse aux dromans de la cour de la Nuit la charge de protéger les graines sauvages et de défendre leurs bosquets.', 37474);
