INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(1309, 'frFR', 'Animacarus cliquetant', '|cFFFFD200Aventures :|r Ombreterre|n', 'Ces créatures volantes exceptionnellement agiles font d\’excellentes montures une fois qu\’on leur a appris à ne pas vider leur cavalier de tout son anima.', 37474),
(1420, 'frFR', 'Fauche-corne ombreux', '|cFFFFD200Vendeur : |rFusenez|n|cFFFFD200Région : |rSylvarden|n', 'Les gorms ombreux sont les plus dociles de tous, mais leurs cornes et mandibules sont bien plus imposantes que celles de leurs congénères. S\’ils sont aussi affables, c\’est sans doute parce que les autres créatures prennent bien soin de ne pas les contrarier.', 37474),
(1414, 'frFR', 'Vicéquin Blanchette', '|cFFFFD200PNJ :|r Feu Blanchette |n|cFFFFD200Lieu :|r Revendreth|n |n', 'De son vivant, Blanchette était une jument affectueuse, obéissante et dotée d\’un solide appétit. Quels crimes a-t-elle pu commettre en secret pour se retrouver parmi les âmes condamnées de Revendreth ?', 37474),
(1291, 'frFR', 'Yun porte-bonheur', '|cFFFFD200Boutique en jeu|r|n', 'Les Pandarens pensent qu\’il suffit de caresser la peau brillante d\’un bœuf pour devenir riche. Encore faut-il réussir à en capturer un…', 37474),
(1424, 'frFR', 'Polaris', '|cFFFFD20030e anniversaire de Blizzard|r', 'Dans la glace et la neige il est né, sous le soleil d\’Azeroth où les héros vont s\’aventurer.', 37474);
INSERT INTO `lfg_dungeons_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
