(2092, 'frFR', 'Le sang de la pierre', 'À l\’affût, les généraux de la Légion de pierre de Denathrius préparent un piège qui écrasera définitivement la rébellion.', 37474),
(2090, 'frFR', 'Caveaux drainants', 'L\’anima s\’écoule des caveaux du château Nathria comme d\’une plaie béante. Il faut stopper l\’hémorragie avant que Revendreth ne soit complètement exsangue.', 37474),
(2096, 'frFR', 'Audience avec l\’arrogance', 'À l\’abri dans sa tour, Denathrius attend avec impatience les héros pour l\’ultime confrontation qui scellera le sort de Revendreth.', 37474),
(2091, 'frFR', 'Reliquaire de l\’opulence', 'Alors que les aristocrates célèbrent leur victoire, les héros doivent débarquer dans leur réception et démanteler leur base de pouvoir.', 37474),
