INSERT INTO `mail_template_locale` (`ID`, `locale`, `Body_lang`, `VerifiedBuild`) VALUES
(568, 'frFR', '$p,\n\nJe ne contesterai pas le nombre de proies que vous annoncez avoir tuées dans votre dernière lettre.\n\nCe score me paraît très élevé, mais vous êtes $gle:la; Sans-entraves…\n\nJ\’apprécie quand même notre petite compétition et je m\’efforcerai de suivre votre rythme.\n\nJ\’ai moi-même asséné cent trente-huit coups mortels depuis votre lettre précédente, et–\n\n<La phrase du capitaine de l\’Hallali Korayn s\’interrompt brusquement.>\n\nCent cinquante-deux, finalement ! Il y avait peut-être quelques acari dans le lot, mais je ne peux pas faire la fine bouche avec l\’avance que vous avez !\n\nJe vous défie de faire mieux !\nKorayn, capitaine de l\’Hallali', 37474);
INSERT INTO `chr_classes_locale` (`ID`, `locale`, `Name_lang`, `NameMale_lang`, `NameFemale_lang`, `Description_lang`, `RoleInfoString_lang`, `DisabledString_lang`, `HyphenatedNameMale_lang`, `HyphenatedNameFemale_lang`, `VerifiedBuild`) VALUES
(3, 'frFR', 'Chasseur', 'Chasseur', 'Chasseresse', 'Les chasseurs se sentent chez eux dans la nature et ont une affinité spéciale avec les animaux. Ils utilisent leurs armes ainsi que leur familier pour infliger des dégâts.', 'Rôles : |cffffffffinfliger des dégâts en mêlée ou à distance|r', 'Vous devez choisir une race compatible avec cette classe.', 'Chasseur', 'Chasse-|nresse', 37474),
(1, 'frFR', 'Guerrier', 'Guerrier', 'Guerrière', 'Les guerriers portent une armure en plaques et aspirent à la perfection dans les combats. Lorsqu\’ils combattent, ils génèrent de la rage, utilisée pour alimenter leurs attaques spéciales.', 'Rôles : |cffffffffencaisser ou infliger des dégâts en mêlée|r', 'Vous devez choisir une race compatible avec cette classe.', 'Guerrier', 'Guerrière', 37474),
(11, 'frFR', 'Druide', 'Druide', 'Druidesse', 'Les druides sont des changeformes ayant une affinité avec les plantes et les animaux. Il existe différents types de druides : le soigneur, le lanceur de sorts à distance ou celui qui prend une forme de félin ou d\’ours pour combattre au corps à corps.', 'Rôles : |cffffffffsoigner, encaisser, infliger des dégâts à distance ou en mêlée|r', 'Vous devez choisir une race compatible avec cette classe.', 'Druide', 'Druidesse', 37474),
(5, 'frFR', 'Prêtre', 'Prêtre', 'Prêtresse', 'Les prêtres disposent d\’une grande palette d\’outils pour soigner, mais ils peuvent également sacrifier leurs soins pour infliger des dégâts grâce à la magie de l\’Ombre.', 'Rôles : |cffffffffsoigner ou infliger des dégâts à distance|r', 'Vous devez choisir une race compatible avec cette classe.', 'Prêtre', 'Prêtresse', 37474),
(8, 'frFR', 'Mage', 'Mage', 'Mage', 'Les mages sont les utilisateurs emblématiques de la magie en Azeroth, qui apprennent leur art au cours de leurs recherches et études approfondies. Ils portent des armures légères, mais compensent cette faiblesse par une puissante gamme de sorts offensifs et défensifs.', 'Rôle : |cffffffffinfliger des dégâts à distance|r', 'Vous devez choisir une race compatible avec cette classe.', 'Mage', 'Mage', 37474),
(7, 'frFR', 'Chaman', 'Chaman', 'Chamane', 'Les chamans invoquent la puissance des éléments pour améliorer les dégâts de leurs armes ou sorts. Lors des combats, ils invoquent des totems, de petits objets qui immobilisent, soignent ou infligent des dégâts.', 'Rôles : |cffffffffsoigner, infliger des dégâts à distance ou en mêlée|r', 'Vous devez choisir une race compatible avec cette classe.', 'Chaman', 'Chamane', 37474),
(12, 'frFR', 'Chasseur de démons', 'Chasseur de démons', 'Chasseuse de démons', 'Le chasseur de démons est une classe de héros, donc il débute le jeu à haut niveau. C\’est un paria qui utilise des pouvoirs démoniaques interdits, afin de pourchasser ses ennemis.', 'Rôles : |cffffffffencaisser ou infliger des dégâts en mêlée|r', 'Nécessite Legion et un personnage de niveau 70.', 'Chasseur de démons', 'Chasseuse de démons', 37474),
(9, 'frFR', 'Démoniste', 'Démoniste', 'Démoniste', 'Les démonistes utilisent la magie du Feu ou de l\’Ombre pour infliger des dégâts, drainer ou maudire leurs ennemis. Ils peuvent également invoquer des démons qui leur obéissent.', 'Rôle : |cffffffffinfliger des dégâts à distance|r', 'Vous devez choisir une race compatible avec cette classe.', 'Démoniste', 'Démoniste', 37474),
(4, 'frFR', 'Voleur', 'Voleur', 'Voleuse', 'Les voleurs endossent souvent le rôle d\’assassin ou d\’éclaireur, mais nombre d\’entre eux sont des loups solitaires. Ils peuvent se déplacer furtivement autour de leurs ennemis ou attaquer un adversaire dans le dos pour tenter de l\’achever rapidement.', 'Rôle : |cffffffffinfliger des dégâts en mêlée|r', 'Vous devez choisir une race compatible avec cette classe.', 'Voleur', 'Voleuse', 37474);
